                    parentQuestion: gr.getDisplayValue('parent_question')
                };
                tableArr.push(obj);

            }
        }


        function getParentQuest(arr) {
            return arr.filter(function(ques) {
                return ques.parentQuestion == "" || ques.parentQuestion === null || !ques.parentQuestion;
            });
        }


        function filterByCode(arr, code) {
            return arr.filter(function(ques) {
                return ques.code === code;
            });
        }

