sys_variable_value.value:
(function execute(inputs, outputs) {
var isproposer = inputs.quoteReq.isProposer;

var depflag = isproposer === "true" ? "Y" : "N";
outputs.depflag = depflag;

var nomi=inputs.reqBody.data.nomineeInfos;
var array=[];
nomi.forEach(function(nom){
    array.push({
        "frstNm":nom.frstNm,
        "lstNm":nom.lstNm,
        "dob":transformDateFormat(nom.dob),
        "gender":nom.gender,
        "relationship":nom.relationship,
        "apnteDtls":{
            "frstNm":nom.apnteDtls.frstNm,
            "relationship":nom.apnteDtls.relatedParty,
            "gender":nom.apnteDtls.gender,
            "dob":transformDateFormat(nom.apnteDtls.dob),
            "lstNm":nom.apnteDtls.lstNm
        }
    })
})
var nomOut=array;
outputs.nomout=JSON.stringify(nomOut[0]);


})(inputs, outputs);
function transformDateFormat(dateString) {
    var months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];
    
    var parts = dateString.split("/");
    if (parts.length === 3) {
        var day = parts[0];
        var month = months[parseInt(parts[1], 10) - 1]; 
        var year = parts[2];
        return `${day}-${month}-${year}`; 
    }
    return dateString; 
}

