    if (nriFlag == "true") {

        var tableArr = [];
        var gr = new GlideRecord('x_rptp_smartinte_0_integration_question_configuration');
        gr.addQuery('insurer', 'e107033affc3c29019a8ffda7c4fd95f');
        gr.query();
        while (gr.next()) {
            if (gr.getValue('code')) {
                var obj = {
                    code: gr.getValue('code'),
                    ques: gr.getValue('question'),
                    ans: gr.getValue('answer_number'),
                    parentQuestion: gr.getDisplayValue('parent_question')
                };
                tableArr.push(obj);

            }
        }


        function getParentQuest(arr) {
            return arr.filter(function(ques) {
                return ques.parentQuestion == "" || ques.parentQuestion === null || !ques.parentQuestion;
            });
        }


        function filterByCode(arr, code) {
            return arr.filter(function(ques) {
                return ques.code === code;
            });
        }

        function getChildQuestions(arr, code) {
            return arr.filter(function(ques) {
                return ques.parentQuestion === code;
            });
        }

        var obj = {};
        var quest = [];
        var key = "";
        inputArray.forEach(function(arr) {

            if (arr.code == "NRI01") {
                gs.info("hii");
                ans = arr.answer1
                gs.info(ans + "hehe");

            }

            if (arr.code == "NRI02") {
