            }

            quest = filterByCode(tableArr, arr.code);

            if (arr.code == "NRI12" || arr.code == "NRI12_L") {
                var parentQues = getParentQuest(quest)[0];

                if (arr.answer1 == "Yes") {
                    var array = []
                    var childQuestions = getChildQuestions(quest, parentQues.code);

                    var ans2 = arr.answer2;
                    ans2.forEach(function(travel) {
                        var jobj = {}
                        childQuestions.forEach(function(childQues) {
                            var key = childQues.ques;
                            var value = childQues.ans;
                            jobj[key] = travel[value];
                        });

                        array.push(jobj)
                    });
                    obj["nriTravelDetails"] = array;
                     var key = parentQues.ques;
                    obj[key] = arr.answer1 || "";

                } else if (arr.answer1 == "No") {
                    var key = parentQues.ques;
                    obj[key] = arr.answer1 || "";
                }


            } else {
                quest.forEach(function(nriQues) {
                    key = nriQues.ques;
                    obj[key] = arr[nriQues.ans] || "";
                });
            }
        });


    }
    if (nriFlag == "true") {
        state = "0";
        pin = "999999";
        var rstSts = "NRI";
        obj.nriOtherResCountry = "Yes";
        obj.nriBirthCountry = "India";
        obj.countryOfNationality = "India";
        obj.currentresidence = inputs.comm;
        outputs.comm_line = inputs.commValues.line3 + " " + inputs.commValues.state + " " + inputs.commValues.pincode;

